import {useState} from "react";


function List({contacts}){

  const [filterText,setFilterText] = useState(" ");

  const handleFilter = (event) => {
    const newFilter=event.target.value;
    setFilterText(newFilter);
  }

  return(
    <div>
     <ul>
       {
         contacts.map((item,index) => <li key={index}>{item.fName}</li>)
       }
     </ul>
     <input name="filterText" placehlder="Search" onChange={handleFilter} value={filterText}></input>
    </div>
  )
}
export default List;
